              <a href={'/SignUp'} rel="noopener noreferrer">No posee cuenta? Registrese!</a>

              <BotonFormulario className="boton-siguiente" name="boton" value="Ingresar" />
              </div>
            </Form>
          </Formik>
        </div>
      </div>
    </div>
  );
}

export default Login;
